Verenigde Staten
Drama
123 minuten

goed

met Jim Sturgess, Kevin Spacey en Kate Bosworth

Om zijn collegegeld te betalen, gaat de verlegen maar briljante Ben Campbell (Jim Sturgess) samen met een selecte groep 
topstudenten elk weekend naar Las Vegas. Het doel: hun kennis gebruiken om de uitkomsten van blackjack naar hun hand te zetten. 
Onder leiding van de onorthodoxe wiskundeprofessor en statistiekgenie Micky Rosa (Kevin Spacey), kraken ze de code en verslaan 
ze de casino's keer op keer. Verleid door het grote geld, de Vegas levensstijl, en zijn sexy teamgenote Jill Taylor 
(Kate Bosworth), zoekt Ben de grenzen op. Maar hij moet zijn hoofd bij de kaarten houden en de casinobewaking van Cole Williams 
(Laurence Fishburne) te slim af zijn. Anders kunnen de gewonnen miljoenen ze wel heel duur komen te staan.
